import{_ as r,C as s,c as p,o as i,a7 as e,G as o}from"./chunks/framework.CbZ0TyXs.js";const l="/blog/assets/01.khn-VCZK.png",n="/blog/assets/02.3nbya0Rm.png",h="/blog/assets/03.DEm4U3GB.png",d="/blog/assets/04.CggLxZ-9.png",c="/blog/assets/05.CDB8Tx81.png",_="/blog/assets/06.BkJ3ls_0.png",k=JSON.parse('{"title":"YAPC::Kyoto 2023","description":"初ITカンファレンス & LT","frontmatter":{"date":"2023-03-20T00:00:00.000Z","title":"YAPC::Kyoto 2023","description":"初ITカンファレンス & LT","tags":["YAPC"],"prev":false,"next":{"text":"函館市電LT","link":"/posts/2023/09/01"}},"headers":[],"relativePath":"posts/2023/03/20.md","filePath":"posts/2023/03/20.md"}'),m={name:"posts/2023/03/20.md"};function P(b,a,u,T,g,q){const t=s("X");return i(),p("div",null,[a[0]||(a[0]=e('<h1 id="yapc-kyoto-2023" tabindex="-1">YAPC::Kyoto 2023 <a class="header-anchor" href="#yapc-kyoto-2023" aria-label="Permalink to &quot;YAPC::Kyoto 2023&quot;">​</a></h1><p> 3/19 に <a href="https://yapcjapan.org/2023kyoto/" target="_blank" rel="noreferrer">YAPC::Kyoto 2023</a> に参加してきました。</p><h2 id="yapc-kyoto-2023-前日祭" tabindex="-1">YAPC::Kyoto 2023 前日祭 <a class="header-anchor" href="#yapc-kyoto-2023-前日祭" aria-label="Permalink to &quot;YAPC::Kyoto 2023 前日祭&quot;">​</a></h2><p> 3/18 には、<a href="https://yapcjapan.connpass.com/event/276583" target="_blank" rel="noreferrer">YAPC::Kyoto 2023 前日祭</a> に参加しました。</p><h2 id="ネコトーストラボ杯争奪-東西対抗-ltマッチ" tabindex="-1">ネコトーストラボ杯争奪 東西対抗 LTマッチ <a class="header-anchor" href="#ネコトーストラボ杯争奪-東西対抗-ltマッチ" aria-label="Permalink to &quot;ネコトーストラボ杯争奪 東西対抗 LTマッチ&quot;">​</a></h2><p> 「YAPC::Kyoto 2023前日祭」内のイベント「ネコトーストラボ杯争奪 東西対抗 LTマッチ」に、登壇しました。</p>',6)),o(t,{tweetId:"1638784761748672514"}),a[1]||(a[1]=e('<p> 東側チームのMVPを受賞をすることができました。</p><h2 id="登壇内容" tabindex="-1">登壇内容 <a class="header-anchor" href="#登壇内容" aria-label="Permalink to &quot;登壇内容&quot;">​</a></h2><p> 登壇内容は「TypeSciprt + Express + Prisma + Node.js API開発」。入社してから、初業務で学んだことをまとめた内容です。</p><h2 id="perlについて思うこと" tabindex="-1">Perlについて思うこと <a class="header-anchor" href="#perlについて思うこと" aria-label="Permalink to &quot;Perlについて思うこと&quot;">​</a></h2><p> 冒頭では、Perlの本音について。 くじ引きで、一番最後の登壇なのでしたが、他の登壇者の発表を聞いた後、このスライドを作ったことを後悔。</p><p> Perl愛好家が集まるイベントで、このスライドを発表するのは、空気を壊してしまうのではないかと、発表直前にとても不安になっていた。</p><p><img src="'+l+'" alt="img"></p><h2 id="typescript" tabindex="-1">TypeScript <a class="header-anchor" href="#typescript" aria-label="Permalink to &quot;TypeScript&quot;">​</a></h2><p> TypeScriptは、JavaScriptの型を導入することで、JavaScriptの開発をより安全に、より効率的に行うことができる言語。</p><p><img src="'+n+'" alt="img"></p><h2 id="prisma" tabindex="-1">Prisma <a class="header-anchor" href="#prisma" aria-label="Permalink to &quot;Prisma&quot;">​</a></h2><p> 手動でSQLクエリを書く必要ない。SQLを意識せずに、データ操作が可能。</p><p><img src="'+h+'" alt="img"></p><h2 id="express" tabindex="-1">Express <a class="header-anchor" href="#express" aria-label="Permalink to &quot;Express&quot;">​</a></h2><p> Node.jsのWebフレームワーク。軽量で、柔軟性が高い。</p><p><img src="'+d+'" alt="img"></p><h2 id="レイヤードアーキテクチャーを参考にした構成" tabindex="-1">レイヤードアーキテクチャーを参考にした構成 <a class="header-anchor" href="#レイヤードアーキテクチャーを参考にした構成" aria-label="Permalink to &quot;レイヤードアーキテクチャーを参考にした構成&quot;">​</a></h2><p> 各層を独立して設計しているため、役割が明確になる。Domain層により、コード量を大幅に抑えることが可能。</p><p><img src="'+c+'" alt="img"></p><h2 id="まとめ" tabindex="-1">まとめ <a class="header-anchor" href="#まとめ" aria-label="Permalink to &quot;まとめ&quot;">​</a></h2><p> 開発する時には、自分のような初業務の人もいれば、ベテランエンジニア、営業の方など、様々な人がいる。全員が全員、同じような知識を持っているわけではないので、共通の知識を持った上で、開発を進めることが重要だと感じました。</p><p><img src="'+_+'" alt="img"></p><h2 id="mvp賞" tabindex="-1">MVP賞 <a class="header-anchor" href="#mvp賞" aria-label="Permalink to &quot;MVP賞&quot;">​</a></h2>',23)),o(t,{tweetId:"1645386082308227072"}),a[2]||(a[2]=e('<h2 id="yapc-kyoto-2023-当日" tabindex="-1">YAPC::Kyoto 2023:当日 <a class="header-anchor" href="#yapc-kyoto-2023-当日" aria-label="Permalink to &quot;YAPC::Kyoto 2023:当日&quot;">​</a></h2><p> 当日は、様々なタイムテーブルを回りました。</p><h2 id="印象的な登壇内容" tabindex="-1">印象的な登壇内容 <a class="header-anchor" href="#印象的な登壇内容" aria-label="Permalink to &quot;印象的な登壇内容&quot;">​</a></h2><h3 id="「マルチテナントの実現における技術選定の審美眼とdb設計-postgresqlを添えて-」" tabindex="-1">「マルチテナントの実現における技術選定の審美眼とDB設計 ~ PostgreSQLを添えて ~」 <a class="header-anchor" href="#「マルチテナントの実現における技術選定の審美眼とdb設計-postgresqlを添えて-」" aria-label="Permalink to &quot;「マルチテナントの実現における技術選定の審美眼とDB設計 ~ PostgreSQLを添えて ~」&quot;">​</a></h3><p> 登壇を聞けばデータベース設計について理解できた気になるくらい、シンプルでとても説明が分かりやすかった。</p><h3 id="ソフトウェアエンジニアリングサバイバルガイド-廃墟を直す、廃墟を出る、廃墟を壊す、あるいは廃墟に暮らす、廃墟に死す" tabindex="-1">ソフトウェアエンジニアリングサバイバルガイド: 廃墟を直す、廃墟を出る、廃墟を壊す、あるいは廃墟に暮らす、廃墟に死す <a class="header-anchor" href="#ソフトウェアエンジニアリングサバイバルガイド-廃墟を直す、廃墟を出る、廃墟を壊す、あるいは廃墟に暮らす、廃墟に死す" aria-label="Permalink to &quot;ソフトウェアエンジニアリングサバイバルガイド: 廃墟を直す、廃墟を出る、廃墟を壊す、あるいは廃墟に暮らす、廃墟に死す&quot;">​</a></h3><p> ソフトウェアについても現実に存在する「モノ」のように定期的あるいは継続的なメンテナンスが必要であり、メンテナンスを楽にするためには、より簡潔なコーディングをするべきだと感じました。</p><h2 id="the-end" tabindex="-1">The end <a class="header-anchor" href="#the-end" aria-label="Permalink to &quot;The end&quot;">​</a></h2><p> 多様性を受け入れており、誰でも歓迎している感じが、YAPCイベントの良さだと思いました。私は、今回の「YAPC::Kyoto 2023」が、初参加のITカンファレンスで、LTに登壇するのも初めてでした。また、知見を深められ、業務に役に立てられるように感じました。</p>',9))])}const f=r(m,[["render",P]]);export{k as __pageData,f as default};
